import React from 'react'

const Home = (props) => {
  return(
    <div className="grid-x grid-margin-y">
      <div className="cell">
        <ht>War: Star Trek Edition</ht>
        <button className="button" onClick={new("game")}>Play Now</button>
      </div>
    </div>
  )
}

export default Home
